  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Elk
  Refuge outlines Refuge accomplishments from September through December of 1959.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments. Resource management is outlined; topics include
  grazing. A progress report on field investigations and applied research is also
  provided. The public relations section discusses recreational uses, Refuge visitors,
  and Refuge participation. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
